Flames.Internal.generateUid = (function(uid) {
    uid = uid.toString();

    var newUid = md5(uid);
    newUid = newUid.substring(0, 18 - uid.length);

    for (var i = 0; i < uid.length; i++) {
        if (uid[i] === '0') {
            newUid += 'a';
        } else if (uid[i] === '1') {
            newUid += 'e';
        } else if (uid[i] === '2') {
            newUid += 'd';
        } else if (uid[i] === '3') {
            newUid += 'b';
        } else if (uid[i] === '4') {
            newUid += 'c';
        } else if (uid[i] === '5') {
            newUid += 'f';
        } else if (uid[i] === '6') {
            newUid += '3';
        } else if (uid[i] === '7') {
            newUid += '2';
        } else if (uid[i] === '8') {
            newUid += '1';
        } else if (uid[i] === '9') {
            newUid += '0';
        }
    }
    return newUid;
});

Flames.Internal.HttpResponse = [];

Flames.Internal.dump = function(param1, param2) {
    if (Flames.Internal.dumpLocalPath === undefined) {
        param2 = param2.replace('{DUMP_LOCAL_PATH}', '');
        console.log(param1, param2);
    } else {
        param2 = param2.replace('{DUMP_LOCAL_PATH}', Flames.Internal.dumpLocalPath);
        console.log(param1, param2);
    }
};

Flames.Internal.Http = (function(data) {
    var data = Flames.Internal.unserialize(data);
    if (data.header !== null && data.header !== undefined && data.header.body !== null && data.header.body !== undefined) {
        data.header.body = atob(data.header.body);
    }
    
    var params = null;

    if (data.header.form_params !== undefined) {
        params = data.header.form_params;
        data.header.form_params = undefined;
    }

    if (data.header.body !== undefined && data.header.body !== null) {
        params = data.header.body;
        data.header.body = undefined;
    }

    var axiosData = {
        method: data.method,
        url: data.url,
        data: params,
        responseType: 'text',
        headers: data.header,
        withCredentials: true
    }

    Flames.Internal.HttpAxios(axiosData).then(function (_response) {
        var headers = [];
        var key;
        for (key in _response.headers) {
            if (_response.headers.hasOwnProperty(key)) {
                headers[headers.length] = [key, _response.headers[key]];
            }
        }

        var response =
        {
            status: _response.status,
            body: _response.data,
            header: headers
        }

        window.PHP.eval('<?php Flames\\Http\\Client::callback(' + data.id + ', \'' + btoa(response.status) + '\', \'' + btoa(response.body) + '\', \'' + btoa(JSON.stringify(response.header)) + '\'); ?>');
    }).catch(function (error) {

        if (error.response !== undefined && error.response !== null && error.response.data !== undefined && error.response.data !== null) {
            error.message = error.response.data;
        }

        var response =
        {
            status: 'error',
            message: error.message,
            header: []
        };

        window.PHP.eval('<?php Flames\\Http\\Client::callback(' + data.id + ', \'' + btoa(response.status) + '\', \'' + btoa(response.message) + '\'); ?>');
    });
});

