Flames.Internal.onClick = (function(uid) {
    var event = Flames.Internal.Build.click[uid];
    if (event === null || event === undefined) {
        return;
    }

    var _class = decodeURIComponent(event[0]);
    var method = event[1];
    window.PHP.eval('<?php \\Flames\\Kernel\\Client\\Dispatch::onClick(\'' + _class + '\',\'' + method + '\', \'[' + Flames.Internal.char + 'click="' + uid + '"]\'); ?>');
});

